import React from 'react'
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'


class App extends React.Component{

  constructor(props){
    super(props)
    this.state = {
      pokemon : null
    }
  }

  async componentDidMount(){
    const response = await fetch('http://localhost:4242/pokemons/27')
    console.log('response : '+response)
    const data = await response.json()
    console.log('data : '+data)

    this.setState({pokemon : data.name})
  }

  async componentDidMount(){
    const response = await fetch('http://localhost:4242/pokemons/55')
    const data = await response.json()
    this.setState({pokemon : data[0]['nom']})
    //const reset = data[0]['nom'];
  }

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hello to pokedex
          </p>
          <span style={{color : 'red'}}> JSON : {this.state.pokemon} </span>

        </header>
      </div>
    );
  }






  }
export default App;
